import logo from './logo.svg';
import './App.css';
import $ from 'jquery'

class TechnicalCharacteristics {
  constructor() {
    this.model = model
  }
}
class Car {

  constructor(name, description, photo, contacts, technicalCharacteristics, options) {
    this.name = name
    this.description = description
    this.photo = photo
    this.contacts = contacts
    this.technicalCharacteristics = technicalCharacteristics
    this.options = options
  }
}


function App() {

  return (
    <>
      <button onClick={() => {
        $.ajax({
          type: "POST",
          url: "http://fb53de84e409.ngrok.io/cars/add-car",
          data: {car: new Car("Автомобиль", "авто", ["521.jpg"], "+793232216")}
        }).then(it =>
        {
          $.get("http://fb53de84e409.ngrok.io/cars").then(it => {console.log(it)})
          console.log(it)
        })
      }}>AddCar</button>
      <div>
        <input id={"car-input"} placeholder={"CarId"}/>
        <button onClick={() => {
          console.log($("#car-input").val())
          $.get(`http://fb53de84e409.ngrok.io/cars/delete-car?id=${$("#car-input").val()}`).then(it => {
            $.get("http://fb53de84e409.ngrok.io/cars").then(it => {console.log(it)})
            console.log(it)
          })

        }} >RemoveCar</button>
      </div>

    </>
  );
}

export default App;
